INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('9002859067907', 'Soft biscuits - Saveur abricot', 'DE: Eigebäck 44% [Zucker, WEIZENmehl, pasteurisierte EIERmasse, Maisstärke, Glukosesirup, Kartoffelgranulat (getrocknete Kartoffeln, Emulgator: E471; Stabilisator: E450; Konservierungsstoff: E223; Antioxidationsmittel: E304), Feuchthaltemittel: E420, E422; Molkenpulver (aus MILCH), Backtriebmittel: E503, E500, E450; Aromen, Konservierungsstoff: E202; Speisesalz, Emulgator: E471, Säureregulator: E330], Cremefüllung mit Sahnegeschmack 30% [pflanzliche Fette (Palm, Raps, Kokosnuss; in veränderlichen Gewichtsanteilen), Zucker, Molkenpulver (aus MILCH), Glukose,SAHNEpulver 0,5%, Emulgator: E322; Aroma], Füllung mit Aprikosengeschmack 16% [Apfelpüree, Zucker, Verdickungsmittel: E1414; Geliermittel: E440; Säureregulator: E330; Aprikosenkonzentrat 0,2%, Konservierungsstoff: E202; Aroma, Farbstoff: E100], Kakaoglasur 8% [Zucker, ganz gehärtetes Palmfett, Magerkakaopulver 15,5%, Stabilisator: E492; Emulgator: E322 (SOJA); Aroma], Glasur mit Milchgeschmack 2% [Zucker, ganz gehärtetes Palmfett, Molkenpulver (aus MILCH), Emulgator: E322; Aroma, Farbstoff: E171]. FR: Eigebäck 44% de sucre [, farine de blé, mélange d\'oeuf pasteurisé, l\'amidon de maïs, sirop de glucose, des granules de pomme de terre (pommes de terre séchés, émulsifiant: E471, stabilisant: E450, conservateur: E223; Antioxydant: E304) humectant: E420, E422; Lactosérum en poudre (de MILK), agents de levure: E503, E500, E450; Saveurs, conservateur: E202; Sel, émulsifiant: E471, correcteur d\'acidité: E330], le remplissage de crème à saveur de crème 30% [graisses végétales (palme, colza, noix de coco, dans des proportions variables), le sucre, la poudre de lactosérum (de lait), le glucose, la poudre de crème à 0,5%, émulsifiant: E322 ; Arôme], fourrage aromatisé à l\'abricot 16% [purée de pomme, sucre, épaississant: E1414; Agent gélifiant: E440; Régulateur d\'acidité: E330; Concentré d\'abricot 0,2%, conservateur: E202; Saveur, couleur: E100], glaçage de cacao 8% [sucre, graisse de palme très durci, poudre de cacao maigre 15,5%, stabilisant: E492; Émulsifiant: E322 (SOYA); Saveur, glaçure à saveur de lait 2% [sucre, graisse de palme entièrement hydrogénée, poudre de lactosérum (provenant du LAIT), émulsifiant: E322; Saveur, couleur: E171].', 'https://static.openfoodfacts.org/images/products/900/285/906/7907/front_fr.12.400.jpg', '17', '7.5', '64', '39', '', '5.2', '0.3', '0.118110236220472', '', '0');

